import React from 'react';
import { Income, Category } from '../types'; // Importing the interfaces
import IncomeForm from './IncomeForm';

interface IncomeProps {
  incomes: Income[];
  setIncomes: React.Dispatch<React.SetStateAction<Income[]>>;
  categories: Category[];
}

const Incomes: React.FC<IncomeProps> = ({ incomes, setIncomes, categories }) => {
  return (
    <div>
      <h2>Incomes</h2>
      <IncomeForm setIncomes={setIncomes} categories={categories} />
      <table>
        <thead>
          <tr>
            <th>Description</th>
            <th>Amount</th>
            <th>Date</th>
            <th>Category</th>
          </tr>
        </thead>
        <tbody>
          {incomes.map(income => (
            <tr key={income.IncomeID}>
              <td>{income.Description}</td>
              <td>{income.Amount}</td>
              <td>{income.Date}</td>
              <td>{income.CategoryName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Incomes;
